svg.script:
function clickHandler(id){
    if(window.parent.zoomClick){
        window.parent.zoomClick(id);
    }
}

function mouseOverHandler(id){
    if(window.parent.tooltipShow){
        window.parent.tooltipShow(id);
    }
}

function mouseLeaveHandler(string){
    if(window.parent.tooltipHide){
        window.parent.tooltipHide();
    }
}
